DELIMITER $$
--
-- Funciones
--
CREATE DEFINER=`root`@`localhost` FUNCTION `sp_genera_codigo`() RETURNS varchar(4) CHARSET latin1
begin
declare generate, codigo  varchar(4);
declare retorno varchar(4);

repeat
	set generate=substring(cast(rand() AS CHAR),3,4);

	select contacto.con_codigo into codigo from contacto
	where contacto.con_codigo=generate;
until codigo is null
end repeat;

set retorno = concat_ws('-',codigo,generate);
return retorno;
end$$

